import React from "react";
import styled from "styled-components";

const Skill =(props)=>{
    return(
        <Wrapper>
            <IconContainer>
                <i className={props.iconImg}/>
            </IconContainer>
            {props.title}
        </Wrapper>
    )
}

export {Skill};

const Wrapper = styled.div`
flex: 0 12%;
text-align:center;
margin: 2% 4%;
`;

const IconContainer = styled.div`
border-bottom: 1.5px solid black;
margin-bottom: 4%;
padding-bottom: 4%;
`;
